INSERT INTO `news_template` (`id`, `title`, `text`, `image`, `alias`) VALUES
(5, 'Добро пожаловать на Jollyday!', '<p class="notice-item-paragraph">Привет! Спешим тебя поздравить: ты стал одним из первых 500 пользователей своего региона, зарегистрированных на сайте <a href="http://jollyday.ru">jollyday.ru</a>. Мы всей командой очень долго думали, какой подарок тебе сделать, и решили, что вот так просто возьмем и <strong>УМНОЖИМ НА ПЯТЬ</strong> любой твой платеж, сделанный в первые 24 часа после регистрации на сайте. Это поможет тебе воспользоваться многими нашими особыми сервисами и повысить твои шансы на успешные знакомства и свидания. Но это еще не все! Мы даем тебе целых <strong>ТРИ ГАРАНТИИ:</strong></p>\r\n\r\n<ul class="notice-item-list">\r\n<li><strong>ГАРАНТИЯ №1.</strong> Если ты не воспользуешься средствами на своем виртуальном счете в течение трех месяцев, мы готовы вернуть их тебе на счет мобильного телефона. <strong>Ты ничем не рискуешь, пополняя свой виртуальный счет!</strong> Чтобы вывести деньги со счета, просто напиши сообщение в <a href="http://jollyday.ru/support">службу поддержки</a> сайта. Мы гарантируем, что вернем тебе деньги в течение трех дней после получения от тебя такого требования.\r\n\r\n<p class="notice-item-hint">Воспользоваться гарантией возможно только при условии, что пользователь не заказывал платные услуги на сайте в течение трех месяцев после пополнения счета. Вывод средств со счета возможен только в рамках собственных средств на счете без учета бонусов. При выводе средств со счета все бонусные монеты аннулируются.</p>\r\n</li>\r\n<li><strong>ГАРАНТИЯ №2.</strong> Мы гарантируем, что ты обязательно познакомишься на jollyday.ru. Если этого не произойдет, то ты получишь от нас целых 100 долларов!!! Как это работает? Все очень просто! Если ты сделаешь 200 предложений о знакомстве на нашем сайте и в результате получишь менее 10 положительных ответов, то мы перечислим тебе в подарок 100 монет на твой виртуальный счет. Есть только одно условие: ты должен загрузить в свой профиль не менее пяти фотографий перед началом знакомств. Фото должны быть с твоим изображением и не должны удаляться в процессе знакомств на сайте. Добавление новых фото при этом всегда приветствуется!\r\n<p class="notice-item-hint">Подарочные 100 монет будут перечислены на виртуальный счет пользователя, если по истечению 7 (семи) календарных дней после отправки пользователем 200-го предложения общее количество положительных ответов на предложения от данного пользователя будет менее десяти.</p>\r\n</li>\r\n<li><strong>ГАРАНТИЯ №3.</strong> Несмотря на то, что сейчас на сайте очень мало пользователей, тебе здесь не придется долго скучать &ndash; мы активно рекламируем наш сайт знакомств и в самое ближайшее время у тебя будет очень большой выбор кандидатов для знакомства. При этом мы гарантируем тебе, что никогда и ни при каких обстоятельствах мы не будем создавать сами несуществующих пользователей и ты будешь знакомиться у нас только с реальными людьми.\r\n</li>\r\n</ul>\r\n\r\n<p class="notice-item-paragraph">Если у тебя будут вопросы, предложения или пожелания, то обязательно напиши нам сообщение в <a href="http://jollyday.ru/support">службу поддержки</a> сайта. Мы сделаем все возможное, чтобы как можно быстрее ответить тебе и постараться решить любую твою проблему. Желаем тебе приятных знакомств!</p>\r\n', '1.jpg', 'register500'),
(7, 'Вы получили бонус!', '<p>Вы получили 100 бонусных монет !!!</p>\r\n', '2.jpg', 'backmoney'),
(8, 'Добро пожаловать на Jollyday!', '<p class="notice-item-paragraph">Привет! Теперь ты стал владельцем анкеты на <a href="http://jollyday.ru">jollyday.ru</a>, с чем мы спешим тебя поздравить! :)) И сразу же принимай от нас первый подарок: мы УМНОЖИМ НА ТРИ любой твой платеж, сделанный в первые 24 часа после регистрации на сайте. Это поможет тебе воспользоваться многими нашими особыми сервисами и повысить твои шансы на успешные знакомства и свидания. Но это еще не все! Мы даем тебе целых ДВЕ ГАРАНТИИ:</p>\r\n\r\n<ul class="notice-item-list">\r\n	<li><strong>ГАРАНТИЯ №1.</strong> Если ты не воспользуешься средствами на своем виртуальном счете в течение трех месяцев, мы готовы вернуть их тебе на счет мобильного телефона. <strong>Ты ничем не рискуешь, пополняя свой виртуальный счет!</strong> Чтобы вывести деньги со счета, просто напиши сообщение в <a href="http://jollyday.ru/support">службу поддержки</a> сайта. Мы гарантируем, что вернем тебе деньги в течение трех дней после получения от тебя такого требования.\r\n\r\n	<p class="notice-item-hint">Воспользоваться гарантией возможно только при условии, что пользователь не заказывал платные услуги на сайте в течение трех месяцев после пополнения счета. Вывод средств со счета возможен только в рамках собственных средств на счете без учета бонусов. При выводе средств со счета все бонусные монеты аннулируются.</p>\r\n	</li>\r\n	<li><strong>ГАРАНТИЯ №2.</strong> Мы гарантируем, что ты обязательно познакомишься на jollyday.ru. Если этого не произойдет, то ты получишь от нас целых 100 долларов!!! Как это работает? Все очень просто! Если ты сделаешь 200 предложений о знакомстве на нашем сайте и в результате получишь менее 10 положительных ответов, то мы перечислим тебе в подарок 100 монет на твой виртуальный счет. Есть только одно условие: ты должен загрузить в свой профиль не менее пяти фотографий перед началом знакомств. Фото должны быть с твоим изображением и не должны удаляться в процессе знакомств на сайте. Добавление новых фото при этом всегда приветствуется!\r\n	<p class="notice-item-hint">Подарочные 100 монет будут перечислены на виртуальный счет пользователя, если по истечению 7 (семи) календарных дней после отправки пользователем 200-го предложения общее количество положительных ответов на предложения от данного пользователя будет менее десяти.</p>\r\n	</li>\r\n</ul>\r\n<p class="notice-item-paragraph">Если у тебя будут вопросы, предложения или пожелания, то обязательно напиши нам сообщение в <a href="http://jollyday.ru/support">службу поддержки</a> сайта. Мы сделаем все возможное, чтобы как можно быстрее ответить тебе и постараться решить любую твою проблему. Желаем тебе приятных знакомств!</p>\r\n', '3.jpg', 'register');
